choices.text:
// In case of ZIP_STORED_ENTRY, if the bytesReadFromStream is less than the size,
// we need to return 0, which means we have reached the end of the file.
// This is to fix the issue where there is no EOF flag set in the ZIP_STORED_ENTRY.
if(current.bytesReadFromStream < csize) {
    return 0;
} else {
    return -1;
}

int bufRemaining = buf.remaining();
int toRead = Math.min(bufRemaining, length);
if ((csize - current.bytesRead) < toRead) {
    toRead = (int) (csize - current.bytesRead);
}
buf.get(buffer, offset, toRead);
current.bytesRead += toRead;
return toRead;

